import axios from 'axios';
import React, { useState, useEffect } from "react";

const GetTest = () => {
    const [text, setText] = useState([]);

    useEffect(() => {
        axios.get('https://groupin-songpyeon.herokuapp.com/movie/1').then(Response => {
        setText(Response.data);
        console.log(Response.data);
    }).catch((Error)=> {
        console.log(Error);
    })
        }, [])

    return (
        <>
        {text.map((e) => (
            <div>

              {e.id}, {e.category}, <br></br>

              {e.notice}, {e.createdAt}, <br></br>
              {e.updatedAt}, {e.title}, {e.views}, {e.comments}, <br></br>
              {e.region}, {e.maxParticipants}, {e.groupInfo}, {e.recommend}, <br></br>
              {e.groupNotice}, {e.groupImageUrl} <br></br>
              
            </div>
        ))}
        </>
    );
};

export default GetTest;
